script: |
  super -f text -I q7109.spq | sort > q7109.out

inputs:
  - name: q7109.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( - + col2 * col2, - ( col1 ) * + 48 + 43, - col1 + + col0, CAST ( - col0 AS INTEGER ) * - + 69 );
  - name: tab0

outputs:
  - name: q7109.out
    data: |
      15	81	47
      87	21	10
      97	1	99
